;\n        if (min !== Infinity &amp;&amp; max !== -Infinity) {\n            pad = pad ? (max - min) * .03 : 0;\n            range.start = min - pad;\n            range.end = max + pad;\n        } else console.error('backtesting: scale range error:', min, max, range);\n    };\n}\n\nclearTimeout(window._bt_autoscale_timeout);\n\nwindow._bt_autoscale_timeout = setTimeout(function () {\n    /**\n     * @variable cb_obj `fig_ohlc.x_range`.\n     * @variable source `ColumnDataSource`\n     * @variable ohlc_range `fig_ohlc.y_range`.\n     * @variable volume_range `fig_volume.y_range`.\n     */\n    \"use strict\";\n\n    let i = Math.max(Math.floor(cb_obj.start), 0),\n        j = Math.min(Math.ceil(cb_obj.end), source.data['ohlc_high'].length);\n\n    let max = Math.max.apply(null, source.data['ohlc_high'].slice(i, j)),\n        min = Math.min.apply(null, source.data['ohlc_low'].slice(i, j));\n    _bt_scale_range(ohlc_range, min, max, true);\n\n    if (volume_range) {\n        max = Math.max.apply(null, source.data['Volume'].slice(i, j));\n        _bt_scale_range(volume_range, 0, max * 1.03, false);\n    }\n\n}, 50);\n"},"id":"135938","type":"CustomJS"},{"attributes":{"below":[{"id":"135891"}],"center":[{"id":"135894"},{"id":"135898"},{"id":"135932"}],"height":90,"left":[{"id":"135895"}],"min_border_bottom":6,"min_border_left":0,"min_border_right":10,"min_border_top":3,"outline_line_color":"#666666","renderers":[{"id":"135919"}],"sizing_mode":"stretch_width","title":{"id":"135921"},"toolbar":{"id":"135907"},"toolbar_location":null,"width":null,"x_range":{"id":"135533"},"x_scale":{"id":"135887"},"y_range":{"id":"135885"},"y_scale":{"id":"135889"}},"id":"135883","subtype":"Figure","type":"Plot"},{"attributes":{"coordinates":null,"data_source":{"id":"135567"},"glyph":{"id":"135760"},"group":null,"hover_glyph":null,"muted_glyph":{"id":"135762"},"nonselection_glyph":{"id":"135761"},"view":{"id":"135764"}},"id":"135763","type":"GlyphRenderer"},{"attributes":{"line_alpha":0.1,"l
